INSERT INTO `servicos` (`idServico`, `idCategoria`, `servico`, `ativo`, `valor`, `tempo`, `descricao`, `capa`) VALUES
(54, 2, 'Completo', 1, '160.00', 60, 'Inclui a depilação com cera quente das axilas, buço, virilha, pernas e limpeza de sobrancelhas com pinça. Duração: 1 á 2 horas.', 'http://fastsalon.com.br/storage/20180130/30012018_DepilacaoCompleta.jpg'),
(48, 2, 'Virilha', 1, '59.90', 50, 'Remoção com cera quente dos pelos da virilha e região do ânus. \nDuração: 40 minutos a 1 hora.', 'http://fastsalon.com.br/storage/20180130/30012018_DepilacaoVirilha.jpg'),
(44, 16, 'Drenagem Linfática', 1, '149.90', 60, 'A Drenagem Linfática é manual e leve, que auxilia no processo de eliminação de liquidos, diminuição de inchaços, melhora do aspecto de celulite e do sistema imunológico. Duração 1hora.', 'http://fastsalon.com.br/storage/20180225/25022018_massagemlinftica.jpg'),
(36, 1, 'Mãos', 1, '34.90', 30, 'O serviço inclui remoção do esmalte, corte, cutilagem e esmaltação das mãos. Nossos profissionais utilizam materiais descartáveis e esterilizados em autoclave. Duração do serviço: 30min á 1h.', 'http://fastsalon.com.br/storage/20180129/29012018_28112017Maos.jpg'),
(45, 2, 'Limpeza de sobrancelha', 1, '34.90', 30, 'Remoção do excesso de pelos das sobrancelhas, com pinça, sem modificar o desenho natural. Duração do serviço: 30 minutos', 'http://fastsalon.com.br/storage/20180130/30012018_DepilacaoSobrancelha.jpg'),
(42, 8, 'Penteado', 1, '149.90', 50, 'O serviço inclui secagem, escova, chapinha, baby lis e penteado escolhido pelo cliente. Para facilitar o atendimento, por favor aguarde nossos artistas com o cabelo levemente seco. Duração: 45 minutos á 1 hora.', 'http://fastsalon.com.br/storage/20180211/11022018_CabelosPenteado.jpg'),
(41, 4, 'Maquiagem & Penteado', 1, '299.90', 120, 'Pacote com serviço de maquiagem (inclui aplicação de cílios), e penteado ou escova, chapinha, baby liss. Duração de 1 á 2horas.', 'http://fastsalon.com.br/storage/20180211/11022018_MaquiagemMaquiagemPenteado.jpg'),
(40, 8, 'Escovação & Prancha', 1, '49.90', 60, 'O serviço inclui secagem, escova e chapinha. Para facilitar o atendimento, por favor aguarde nossos artistas com o cabelo levemente seco. Duração: 45 minutos á 1 hora.', 'http://fastsalon.com.br/storage/20180211/11022018_CabelosEscova.jpg'),
(37, 1, 'Pés e Mãos', 1, '44.90', 60, 'O serviço inclui remoção do esmalte, corte, cutilagem e esmaltação dos pés e das mãos. Nossos profissionais utilizam materiais descartáveis e esterilizados em autoclave.  Duração de serviço: 1 a 2 horas.', 'http://fastsalon.com.br/storage/20180127/27012018_28112017PesMaos.jpg'),
(39, 1, 'Pés', 1, '34.90', 30, 'O serviço inclui remoção do esmalte, corte, cutilagem e esmaltação dos pés. Nossos profissionais utilizam materiais descartáveis e esterilizados em autoclave. Duração de serviço: 30min á 1h.', 'http://fastsalon.com.br/storage/20180127/27012018_28112017Pes.jpg'),
(49, 2, 'Meia Perna', 1, '38.90', 30, 'Remoção com cera quente dos pelos da coxa ou da canela com cera quente. Duração do serviço: 30 minutos .', 'http://fastsalon.com.br/storage/20180130/30012018_DepilacaoMeiaPerna.jpg'),
(50, 2, 'Perna Inteira', 1, '49.90', 60, 'Remoção com cera quente dos pelos de toda a perna com a cera quente.  \nDuração do serviço: 45 minutos a 1 hora.', 'http://fastsalon.com.br/storage/20180130/30012018_DepilacaoPernaInteira.jpg'),
(47, 2, 'Axilas e Buço', 1, '38.90', 40, 'Remoção de pelos das axilas e buço com cera quente. \nDuração do serviço: 30 a 45 minutos.', 'http://fastsalon.com.br/storage/20180130/30012018_DepilacaoAxilaBuo.jpg'),
(43, 4, 'Maquiagem', 1, '159.90', 60, 'Inclui desde a preparação da sua pele até a aplicação de cílios. Pedimos que lave bem o rosto antes da nossa artista chegar. Duração: 45 minutos á 1 hora.', 'http://fastsalon.com.br/storage/20180211/11022018_MaquiagemMaquiagem.jpg'),
(34, 16, 'Massagem Relaxante', 1, '110.00', 60, 'A massagem relaxante conta com movimentos suaves e rítmicos, proporcionando relaxamento de toda a musculatura, diminuição da dor e tensões. Duração: 1 hora.', 'http://fastsalon.com.br/storage/20180201/01022018_massagemrelaxante1.jpg'),
(35, 16, 'Massagem Redutora', 1, '149.90', 60, 'A massagem modeladora conta com movimentos mais fortes e profundos, proporcionando melhora na oxigenação dos tecidos, tonificação e redução de medidas. Duração: 1hora.', 'http://fastsalon.com.br/storage/20180201/01022018_drenagemredutora.jpeg'),
(59, 6, 'Corte Masculino & Barba', 1, '49.00', 60, 'O serviço inclui o corte do cabelo e barba (utilizando a maquina ou a tesoura, conforme a preferência do cliente) e a realização do pé do cabelo com a navalha. Todos os nossos artistas utilizam lâminas novas e são descartadas após o uso.', 'http://fastsalon.com.br/storage/20180227/27022018_CORTEBARBA.jpg'),
(61, 6, 'CORTE MASCULINO', 1, '45.00', 60, 'O serviço inclui o corte do cabelo  (utilizando a maquina ou a tesoura, conforme a preferência do cliente) e a realização do pé do cabelo com a navalha. Todos os nossos artistas utilizam lâminas novas e são descartadas após o uso.', 'http://fastsalon.com.br/storage/20180227/27022018_cortemasculino2.jpg'),
(62, 16, 'Massagem Desportiva', 1, '115.00', 60, 'Massagem que prepara e recupera a musculatura para quem pratica exercícios físicos, perfeita para prevenir lesões e aliviar dores pós treino.', 'http://fastsalon.com.br/storage/20180227/27022018_tiposdemassagem.jpg');
